// import React from "react";
import React, { useState } from 'react';

import "./App.css";
import Page from "./Page";
import mePic from "./imgs/me.jpg";

function App() {
  const [listData, setListData] = useState([
    { id: 1, title: 'Item 1', description: 'Additional info for Item 1.' },
    { id: 2, title: 'Item 2', description: 'Additional info for Item 2.' },
    // Add more items as needed
  ]);

  return (
    <div className="App">
      <Page mainCookie = {mePic} additional = "additional"> </Page>
      <Page mainCookie = "hi" additional = "try again"> </Page>
      <List data = {listData} />
    </div>
  );
}

export default App;
